description:
Producers from across Europe discuss how they have had to adapt their productions to meet pandemic safety measures, as well as how they have found new solutions to financing and co-producing in 2020 and beyond. What are the practical measures that producers should follow to shoot safely in this new era?


Speakers: Riina Sildos, founder, Amrion Productions; 
                 Peter Possne, head of production, Film i Vast, 
                 Gareth-Ellis Unwin, head of film and animation, ScreenSkills UK; 
Moderated by Wendy Mitchell
